const Phrase = (qty)=>{
    console.log('utilites',qty)
    if (qty >1 && qty <5) {
        console.log('utilites','человека')
    }
    else if(qty.length(-1) === [2,3,4]){
        console.log('utilites','человека')
    }
    else {
        console.log('человек')
    }
}

export default Phrase
